Cezanne: A Study of his Development
Noonday Press | 1958 | ISBN: N/A | English | 156 pages | PDF | 20.5 MB


Of all the artists in the first Impressionist group exhibition of 1874, Paul Cezanne was to have the widest influence upon the future of Western art, yet he was also the last to achieve recognition and fame. Even the most advanced and liberal among the Parisian critics, Marc de Montifaud, who treated Degas, Monet, Pissarro, and Renoir with respect, if not with enthusiasm, joined in the laughter of the most ignorant and prejudiced upon approaching the Cezannes: &quot;. . . Monsieur Cezanne can only be a kind of madman, afflicted with delirium tremens while painting . . .&quot;
